import React from "react";
import "./style.css"

function Jumbotron({ children }) {
  return (
    <div
      style={{textAlign: "center", backgroundColor: "#FFFFFF"}}
      className="header"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
